 @paulorichard5080  Não. Quando sair o Guedes entra o Adson ou Gustavo. 
O Sylvinho vai ter que mudar esse esquema ou vai ser enxotado do Corinthians, vai ter que fazer uma dupla de volantes, uma dupla de meias e uma dupla de atacantes (Guedes e Willian). Das 4 contratações talvez só o Giuliano é menos diferenciado, mas ainda assim é acima da média comparado ao futebol brasileiro. 
Tirando os top 3 dessa temporada (Mulambo, Porco e Galo) não tem outro time melhor que o Corinthians em relação as peças.

 @igoralvessouza7594  depois das contratações só pegou perebas. olha só o jogo de ontem, cara com dois Volantes e ainda colocando roger Guedes e giuliano pra marcar. cara saiu com dores de tanto correr igual um louco atrás do adversário, Corinthians desistiu do jogo depois que fez o gol. uma coisa que não pode acontecer com a grandeza do corinthians. ainda mais jogando contra esses times fracos, se estava bem jogando indo pra cima, nao tem porq recuar o time, com isso vc fica com muito mais chances de tomar o Gol. e ainda quase sofremos a virada.
Se o Sylvinho parar de ser medroso, ele consegue fazer esse time jogar.
mais se começar a colocar William, Renato Augusto, Giuliano e Roger Guedes pra ficar marcando igual loucos. ai ferra com o projeto

